		/// </summary>
		/// <param name="name">A Unicode block name</param>
		/// <returns>The corresponding block, or null if it does not exists</returns>
		public static UnicodeBlock GetBlock(string name)
		{
			if (db == null) BuildDB();
			if (!db.ContainsKey(name)) return null;
			 return db[name];
		}
